column8:
より高い安定性とより高い制動力、熱処理ローターとスリットローターのメリットを融合して生まれたHSタイプ。ストリートではスリットの効果が得られ低温時から高い摩擦係数を体感でき、サーキットでは比類なき安定性と高温時においても高い摩擦係数を維持します。<br>制動力と安定性を高次元で融合。ストリートからサーキットまであらゆるシチュエーションでパフォーマンスを発揮するディクセルのハイエンドモデルです。※通常商品は6本スリットですが、12本スリット仕様への加工も承ります（加工費税別6000円）。ご注文時にお申し付けください。<br>※スリットローターはパッドの摩耗を早めます。装着の際は左右の向きにご注意下さい。防錆処理・熱処理は一部車種によって異なります。 防錆コーティングは錆の発生を抑制するもので完全に阻止できるものではございません。※必ず当たり付けは行って下さい。<br><br>対応車種：3.4 (4WD) タコマ ( 95～03)<br><br>ブレーキ | ブレーキローター<br>トヨタ | タコマ | 1995-2004モデル<tr><td colspan="2">
