スリットのシェービング効果により、パッドから発生するガスや粉をディスク表面より効率よく排出。およそ20％の制動性能が向上し高い食付き感が得られ、タッチも良くなります。<br>スリットの角度、深さなども実践データにより最適化。防錆コーティングを導入し錆の発生を抑制。ブレーキの効きを良くしたい・フィーリングに不満があるという方やワインディングやサーキット走行を楽しむ方にお勧め。※通常商品は6本スリットですが、12本スリット仕様への加工も承ります（加工費税別6000円）。ご注文時にお申し付けください。<br>※スリットローターはパッドの摩耗を早めます。装着の際は左右の向きにご注意下さい。防錆処理・熱処理は一部車種によって異なります。 防錆コーティングは錆の発生を抑制するもので完全に阻止できるものではございません。 <br><br>対応車種：90/9～91/8 ボルボ 960エステート 2.5/2.8/2.9 (9B6254/280/6304W) ※ABS付<br><br>ブレーキ | ブレーキローター<br>ボルボ | 960 | 全モデル<tr><td colspan="2">
